A gente produz um sebo natural que reveste o couro cabeludo com proteínas e gorduras necessárias para protegê-lo de bactérias, fungos e poluição que são prejudiciais e que podem trazer o mau cheiro pra nossa cabela. Além disso, quando o sebo desce para os fios, por conta própria ou por escovação, ele hidrata as fibras capilares de forma natural. 💚

Quando a gente retira esses óleos naturais, a nossa pele entende que tá produzindo pouco sebo e já manda as glândulas sebáceas produzirem mais e mais, resultando em fios excessivamente oleosos, mais frágeis e sujeitos a ação de bactérias ​​criando a sensação de ‘cabelo e odor sujos'.

Claro que cada cabelo é um cabelo e tem casos de alterações hormonais em que realmente a lavagem diária é necessária. Mas você, que lava o cabelo todo dia e ele continua oleoso... tenta reduzir essas lavagens. Lava com um shampoo sem sulfato todos os dias durante uma semana e depois começa a reduzir para três dias por semana. E depois me conta se o aspecto oleoso do seu cabelo melhorou (:
